import React, {Component} from "react"
import {Nav, Navbar, NavDropdown, Form, FormControl, Button} from "react-bootstrap"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
}from "react-router-dom";

import Home from "../pages/Home";
import Opkut from "../pages/Opkut";
import Bfa from "../pages/Bfa";
import Login from "../pages/Login";

export default class Navbar1 extends Component{
  render(){

    return(
    <Router>
    <div>
    <Navbar bg='navbar' variant='dark'>     
    
    <Nav>
    <Nav.Link as={Link} to={"/"} className="navbtn">Kezd≈ëlap</Nav.Link>
    
      <NavDropdown title="Algo2" className="navbtn">
        <NavDropdown.Item as={Link} to={"/bfa"}>Bfa</NavDropdown.Item>
        <NavDropdown.Item as={Link} to={"/"}>1</NavDropdown.Item>
      </NavDropdown>
    
      <NavDropdown title="Opkut" className='navbtn'>
        <NavDropdown.Item as={Link} to={"/opkut"}>Opkut</NavDropdown.Item>
      </NavDropdown>
      
      <Nav.Link href='/' className="navbtn">Login</Nav.Link>

      <button class="damo" onClick={Damo}>Damo</button>

    </Nav>
    </Navbar>
    </div> 

    <div>
      <Routes>
        <Route path="/bfa">
          <Bfa />
        </Route>
        <Route path="/">
          <Home />
        </Route>

        <Route path="/opkut">
          <Opkut />
        </Route> 

        <Route path="/login">
          <Login />
        </Route>     

      </Routes>
    </div>

    </Router>
    )   
  }
}

function Damo() {
  var element = document.body;
  element.classList.toggle("dark-mode");

}
